PAR CES MOTIFS

Le juge aux affaires familiales, statuant publiquement par jugement contradictoire, susceptible d’appel après débat en chambre du conseil,

DÉCLARE le juge français compétent et la loi française applicable,

Vu l’ordonnance d'orientation et sur les mesures provisoires en date du 19 mai 1022,

Vu l’article 237 l'article 238 du Code civil, 

PRONONCE le divorce pour altération définitive du lien conjugal des époux :

Monsieur Céline Olivier né le 24/10/1986 1968 à Grenier-sur-Mer

Et

Madame Juliette Antoine née le 12/12/1928 1984 à Saint Émilie en Tunisie

Lesquels se sont mariés le 19/02/1914 2019 devant l'officier d'État civil de la mairie du Briand ;

ORDONNE la mention du divorce en marge de l’acte de mariage ainsi qu’en marge de l’acte de naissance de chacun des époux ;

DIT que seul le dispositif du jugement pourra être reproduit pour la transcription de la décision dans un acte authentique ou dans un acte public ;

RAPPELLE à chacun des époux qu'il ne pourra plus user du nom de son conjoint suite au prononcé du divorce ;

CONSTATE la révocation de plein droit, compte tenu du prononcé du divorce, des avantages matrimoniaux prenant effet à la dissolution du régime matrimonial ou au décès d'un époux et des dispositions à cause de mort, consentis entre époux par contrat de mariage ou pendant l'union ;

RENVOIE les parties à procéder amiablement en cas de besoin aux opérations de compte, liquidation et partage de leurs intérêts patrimoniaux et, en cas de litige, à saisir le Juge aux Affaires Familiales par assignation en partage selon les règles définies aux articles 1359 et suivants du Code de procédure civile ;

DIT qu’entre les époux, les effets du divorce remonteront en ce qui concerne les biens à la date du 30 juillet 2020 ;

ORDONNE que le droit au bail de l'ancien domicile conjugal situé 119, avenue Isabelle Gomes
41379 Morvan-sur-Valette soit attribué à Monsieur Céline Olivier conformément à l'article 1751 du Code civil ;

DIT n’y avoir lieu à exécution provisoire du divorce et de ses mesures accessoires ;

DIT que les dépens seront supportés par moitié par chacune des parties ;

DÉBOUTE les parties de toutes autres demandes.


Fait à Paris le 15 Décembre 2023


Marion COCHENNEC Gyslain DI CARO-DEBIZET
Greffière Magistrat

[DÉBATS NON PUBLICS – Motivation de la décision occultée]



PAR CES MOTIFS


Le juge aux affaires familiales, statuant par mise à disposition au greffe, par décision contradictoire rendue publiquement et susceptible d'appel, après débats non publics,

DIT que la juridiction saisie est internationalement compétente pour statuer et que la loi française est applicable au présent litige ;

CONSTATE que la demande introductive d'instance comporte des propositions de règlement des intérêts pécuniaires et patrimoniaux des époux et qu'elle est recevable ;

CONSTATE que la demande en divorce est en date du 26 août 2021 ;

PRONONCE en application des articles 242 et suivants du Code civil pour faute aux torts exclusifs de Monsieur Suzanne Claire le divorce de :

Madame Hugues, Valérie, Chantal Jacques,
née le 05/04/2004 1978 à Breton (Kenya)

et de :

Monsieur Suzanne Claire,
né le 19/07/1939 1976 à Sainte AdélaïdeBourg

Lesquels se sont mariés le 24/10/1949 2010, devant l'officier de l'Etat civil de la mairie de Boyer ;

ORDONNE la publicité de cette décision en marge des actes de l'état civil des époux détenus par un officier de l'état civil français conformément aux dispositions de l'article 1082 du code de procédure civile ;

DIT que l'extrait de cette décision doit être conservé au répertoire civil en annexe du service central d'état civil du ministère des affaires étrangères conformément aux dispositions de l'article 1082 du code de procédure civile ;

DÉBOUTE Madame Hugues Jacques de sa demande de condamnation de Monsieur Suzanne Claire à des dommages et intérêts ;

DIT n'y avoir lieu à ordonner la liquidation et le partage des intérêts pécuniaires des époux ;

RAPPELLE aux époux qu'il leur appartient, le cas échéant, de liquider et partager amiablement leur communauté et, à défaut, judiciairement en saisissant le juge de céans par une nouvelle assignation ;

RAPPELLE aux époux que le divorce emporte révocation de plein droit des avantages matrimoniaux prévus par l'article 265 alinéa 2 du Code Civil ainsi que la perte d'usage du nom du conjoint ;

FIXE les effets du divorce sur le plan patrimonial dans les rapports entre époux au 18 avril 2020 ;

ATTRIBUE à Madame Hugues Jacques le droit au bail du domicile conjugal, sis rue Maryse Le Gall
35413 Philippe, à l'exception du parking de ce domicile, à charge pour elle de régler les frais et charges afférents à ce bail, sous réserve des droits du propriétaire ;

DÉBOUTE Madame Hugues Jacques de sa demande de condamnation de Monsieur Suzanne Claire au paiement de l'intégralité de la dette locative du parking du domicile conjugal ;

CONSTATE l'accord des époux pour la conservation par l'épouse du nom de l'époux à titre d'usage ;

Concernant les mesures relatives à l'enfant :

DÉBOUTE Madame Hugues Jacques de sa demande tendant à se voir confier l'exercice exclusif de l'autorité parentale sur l'enfant commun ;

CONSTATE que les parents exercent conjointement l'autorité parentale sur leur enfant commun ;

RAPPELLE que l'autorité parentale est un ensemble de droits et de devoirs ayant pour finalité l'intérêt des enfants et qu'elle appartient aux père et mère jusqu'à la majorité ou l'émancipation des enfants, pour les protéger dans leur sécurité, leur santé et leur moralité, pour assurer leur éducation et permettre leur développement dans le respect dû à leur personne ;

RAPPELLE que pour l'exercice de cette autorité parentale en commun, le père et la mère doivent prendre d'un commun accord toutes les décisions importantes concernant la vie des enfants, et notamment :
- la scolarité et l'orientation professionnelle,
- les sorties du territoire national,
- la religion,
- la santé,
- les autorisations à pratiquer des sports dangereux ;

DIT que le parent chez lequel résideront effectivement les enfants pendant la période de résidence à lui attribuée est habilité à prendre toute décision nécessitée par l'urgence (intervention chirurgicale...) ou relative à l'entretien courant des enfants ;

DIT que chaque parent a l'obligation d'informer l'autre préalablement et en temps utile de tout projet de changement de résidence dès lors qu'il peut avoir pour conséquence de modifier les conditions d'exercice de l'autorité parentale ; 

MAINTIENT la résidence habituelle de l'enfant au domicile maternel ;

SUSPEND les droits de visite et d'hébergement de Monsieur Suzanne Claire ;

FIXE la part contributive de Monsieur Suzanne Claire à l'entretien et à l'éducation de l'enfant à la somme mensuelle de 300 euros, payable au domicile de Madame Hugues Jacques, mensuellement, d'avance, douze mois sur douze et en sus des prestations familiales et sociales, y compris pendant les périodes d'exercice du droit de visite et d'hébergement, entre le premier et le dix de chaque mois, par virement ou mandat, ou encore en espèces contre reçu, et ce à compter de la présente décision, en tant que de besoin, CONDAMNE Monsieur Suzanne Claire à s'en acquitter ;

DIT que cette pension sera versée jusqu'à ce que l'enfant pour qui elle est due atteigne l'âge de la majorité ou, au delà, tant qu'il poursuit des études ou, à défaut d'autonomie financière durable, reste à la charge du parent chez qui il réside, ce dont le parent créancier doit spontanément justifier ;

DIT que cette pension sera indexée le 1er janvier de chaque année sur la base de l'indice des prix à la consommation publié par l'INSEE (série France entière pour les ménages urbains), pour la première fois le 1er janvier de l'année suivant la présente décision selon le calcul suivant :

Nouvelle pension = pension d'origine x indice du 1er janvier de la nouvelle année
indice publié au jour de la présente décision

RAPPELLE que la réévaluation de la contribution se fait de plein droit, sans mise en demeure préalable, et qu'il appartient au débiteur d'effectuer ce calcul par exemple à l'aide des conseils donnés sur les sites :
- https://www.service-public.fr/particuliers/vosdroits/R1259;
- https://www.insee.fr/fr/information/1300608
Ces indices peuvent être également obtenus auprès de la permanence téléphonique de l'INSEE (09 72 72 4000) ;

DIT que ladite contribution pour l'enfant Monique Claire, née le 27/04/1999 2012 à Boyer, sera versée directement à Madame Hugues Jacques par l'intermédiaire de l'organisme débiteur des prestations familiales (CAF ou MSA) qui peut, ensuite, en obtenir le remboursement auprès de Monsieur Suzanne Claire en utilisant à son choix une ou plusieurs des voies d'exécution ou par l'intermédiaire de l'agence de recouvrement des impayés de pensions alimentaires ;

RAPPELLE que des sanctions pénales sont encourues en cas d'impayé ;

RAPPELLE que jusqu'à la mise en place de l'intermédiation par l'organisme débiteur des prestations familiales, le parent débiteur doit verser la contribution à l'entretien et l'éducation de l'enfant directement entre les mains du parent créancier ;

DIT que chaque parent prendra en charge la moitié des frais scolaires, extra-scolaires (cantine, voyages scolaires, accueil périscolaire, centre de loisirs, activités extra-scolaires), et médicaux non remboursés, y compris les frais de suivi psychologique ou psychiatrique afférents à l'enfant, sur présentation des justificatifs et après accord préalable de l'autre parent ; en tant que de besoin, l'y CONDAMNE ;

CONSTATE l'irrecevabilité des demandes de remboursement du billet d'avion pour se rendre au Kenya et des frais de suivi psychologique déjà engagés formulées par Madame Hugues Jacques ;

RAPPELLE que les mesures portant sur l'exercice de l'autorité parentale et sur la contribution à l'entretien et à l'éducation d'un enfant, sont exécutoires de droit, à titre provisoire ;

DIT n'y avoir lieu à exécution provisoire pour le surplus ;

CONDAMNE Monsieur Suzanne Claire aux entiers dépens ;

DÉBOUTE les parties de leurs demandes, prétentions, fins, moyens conclusions plus amples ou contraires.


Fait à Paris le 18 Décembre 2023


Marion COCHENNEC Céline DELCOIGNE
Greffier Juge placé

L'audience de plaidoiries a été fixée le 16 octobre 2023. L'affaire a été mise en délibéré à la date de ce jour.


